#include"book.h"
std::map<std::string, int>m;
const int NUM = 37039;
BookStruct::BookStruct() {
	memset(N, 0, 32 * sizeof(int));
	memset(MirrorN, 0, 32 * sizeof(int));
	updown = leftright = false;
	result = 0;
	for (int i = 0; i < NUM; ++i) m[ss[i]] = tt[i];
}

void BookStruct::getNow(PositionStruct& chess) {
	if (chess.sdPlayer == 0)
	{
		updown = false;
		memcpy(N, chess.nowPos, 32 * sizeof(int));
		for (int i = 0; i < 32; i++)
		{
			MirrorN[i] = (N[i] - 1) / 9 * 9 + 9 - (N[i] - 1) % 9;
		}
	}
	else
	{
		updown = true;
		for (int i = 0; i < 32; i++)
		{
			if (i < 16)
			{
				N[i] = (9 - (chess.nowPos[i + 16] - 1) / 9) * 9 + (chess.nowPos[i + 16] - 1) % 9 + 1;
			}
			else
			{
				N[i] = (9 - (chess.nowPos[i - 16] - 1) / 9) * 9 + (chess.nowPos[i - 16] - 1) % 9 + 1;
			}
			MirrorN[i] = (N[i] - 1) / 9 * 9 + 9 - (N[i] - 1) % 9;
		}
	}
	static const int tem[][2] = { {1, 3}, {3, 5},  {5, 7},
								 {7, 9}, {9, 11}, {11, 16} };
	for (int i = 0; i < 32; i += 16)
	{
		for (int j = 0; j < 6; ++j)
		{
			std::sort(N + tem[j][0] + i, N + tem[j][1] + i);
			std::sort(MirrorN + tem[j][0] + i, MirrorN + tem[j][1] + i);
		}
	}
	now = "";
	Mirrornow = "";
	for (int i = 0; i < 32; i++) {
		now += char(N[i] + 32);
		Mirrornow += char(MirrorN[i] + 32);
	}
}
int BookStruct::find(PositionStruct& chess)
{
	getNow(chess);
	//cout << now << endl;
	if (m[now] == 0 && m[Mirrornow] == 0)
	{
		result = 0;
	}
	else if (m[now] == 0)
	{
		result = m[Mirrornow];
		leftright = true;
	}
	else
	{
		result = m[now];
		leftright = false;
	}
	if (result)
	{
		int low = result & 255, high = (result - low) >> 8;
		if (leftright)
		{
			low = (low - 1) / 9 * 9 + 9 - (low - 1) % 9;
			high = (high - 1) / 9 * 9 + 9 - (high - 1) % 9;
		}
		if (updown)
		{
			low = (9 - (low - 1) / 9) * 9 + (low - 1) % 9 + 1;
			high = (9 - (high - 1) / 9) * 9 + (high - 1) % 9 + 1;
		}
		result = (high << 8) + low;
	}
	return result;
}
